team_hof_counts = hall_of_fame.CALCULATE(
    player_id = player_id
).salary.CALCULATE(
    team_id = team_id
).PARTITION(name="teams", by=team_id).CALCULATE(
    team_id = team_id,
    num_hof_players = COUNT(hall_of_fame)
).TOP_K(10, by=num_hof_players.DESC())

